entries.desc:
type t = {
  scheme : string;
  authority : string;
  path : string;
  query : string option;
  fragment : string option;
}

type t =
  t/2 = {
  scheme : string;
  authority : string;
  path : string;
  query : string option;
  fragment : string option;
}

type formatter_out_functions =
  formatter_out_functions = {
  out_string : tag -> int -> int -> unit;
  out_flush : unit -> unit;
  out_newline : unit -> unit;
  out_spaces : int -> unit;
  out_indent : int -> unit;
}

type formatter_stag_functions =
  formatter_stag_functions = {
  mark_open_stag : stag -> tag;
  mark_close_stag : stag -> tag;
  print_open_stag : stag -> unit;
  print_close_stag : stag -> unit;
}

value:
(match [(fun j -> Begin (WorkDoneProgressBegin.t_of_yojson j));
      (fun j -> Report (WorkDoneProgressReport.t_of_yojson j));
      (fun j -> End (WorkDoneProgressEnd.t_of_yojson j))]
with
| [] -> _
| _::_ -> _)

match let add = Buffer.add_string b in
      let line k v = add k; add ": "; add v; add crlf in
      line Key.content_length (string_of_int content_length);
      line Key.content_type content_type;
      add crlf;
      Buffer.contents b
with
| "" -> _
| _ -> _

match text_edit ~line
        (if prev_deleted_lines > 0
         then Replace { added = added_lines; deleted = prev_deleted_lines }
         else Insert added_lines)
with
| { newText; range } -> _

match let t =
        {
          clientProcessId = None;
          spec = [];
          stdio = false;
          port = None;
          pipe = None
        } in
      let spec =
        [("--pipe", (Arg.String ((fun p -> t.pipe <- (Some p)))),
           "set pipe path");
        port t ~name:"--socket" ~description:"set the port";
        port t ~name:"--port" ~description:"synonym for --socket";
        ("--stdio", (Arg.Unit ((fun () -> t.stdio <- true))), "set stdio");
        ("--node-ipc",
          (Arg.Unit ((fun () -> raise (Arg.Bad "node-ipc isn't supported")))),
          "not supported");
        ("--clientProcessId",
          (Arg.Int ((fun pid -> t.clientProcessId <- (Some pid)))),
          "set the pid of the lsp client")] in
      t.spec <- spec; t
with
| { pipe; port; stdio; spec; clientProcessId } -> _
